sys_variable_value.value:
(function execute(inputs, outputs) {
    var responseBody = JSON.parse(inputs.responseBody);
    var regions = responseBody.items;
    var listRegions = [];
    regions.forEach(function(region) {
        listRegions.push({
            'label': region.name.toUpperCase(),
            'name': region.name
        });

    })
    outputs.regions = {
        data: listRegions
    }

})(inputs, outputs);

