sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GooglePersistentDiskUtils();
    inputs = gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid']);
    outputs = gcc.maptoOutputFromInput(inputs, outputs, []);
})(inputs, outputs);

